INSERT INTO `news` VALUES (28,'Trao Học bổng Nguyễn Đức Cảnh cho con của nhà giáo và người lao động Trường Đại học Mở Thành phố Hồ Chí Minh','Sáng ngày 19/08/2022, Ban Chấp hành Công đoàn (về sau viết thành BCH CĐ) Trường Đai học Mở Thành phố Hồ Chí Minh đã tổ chức&nbsp;<b>Lễ trao Học bổng Nguyễn Đức Cảnh lần thứ 21</b><span><b>&nbsp;</b>tại cơ sở số 35-37 Hồ Hảo Hớn, Phường Cô Giang, Quận 1, TP.HCM.<br><br></span><span>Đến tham dự Chương trình, có sự hiện diện của đồng chí Hồ Minh Nhiên – Phó Chủ tịch Công đoàn trường; đồng chí Võ Minh Long – Phó Chủ nhiệm Ủy ban&nbsp; Kiểm tra Công đoàn trường; đồng chí Nguyễn Văn Thành – Ủy viên Ban chấp hành Công đoàn trường; đồng chí Nguyễn Thị Hồng Thủy – Ủy viên Ban chấp hành Công đoàn trường cùng quý thầy cô là lãnh đạo các đơn vị, UV BCH CĐ trường, Tổ trưởng công đoàn các đơn vị và 63 bạn đại diện cho 327 bạn đạt thành tích tốt tham dự Lễ trao Học bổng.<br></span><br>Năm học 2021-2022, số học bổng được trao là&nbsp;<span>327&nbsp;</span><span>suất với tổng số tiền là&nbsp;</span><b>139.900.000</b><span>&nbsp;triệu đồng. Học bổng Nguyễn Đức Cảnh được Ban Chấp hành Công đoàn Trường Đại học Mở Thành phố Hồ Chí Minh thực hiện trao cho con của nhà giáo – người lao động thuộc trường để khuyến khích và động viên các bạn nỗ lực phấn đấu đạt thành tích cao trong học tập, góp phần hỗ trợ nhà giáo – người lao động chăm lo đời sống tinh thần cho các cháu</span><span><br><br></span><span>Buổi lễ diễn ra trong không khí vui tươi, sôi nổi với Chương trình nghệ thuật xiếc tung hứng, xiếc thú, tặng bong bóng tạo hình nghệ thuật và những tiết mục hát, múa từ các em tham dự, tạo không gian vui chơi thoải mái.</span><br>',90,'2022-09-03 10:57:04.9'),(29,'Trường Đại học Mở TP.HCM đứng thứ hai bảng xếp hạng SCImago Institutions Rankings 2022 lĩnh vực Kinh tế học, kinh tế lượng và tài chính','<b>Cụ thể, tại lĩnh vực Kinh tế học, kinh tế lượng và tài chính, Trường Đại học Mở Thành phố Hồ Chí Minh đứng thứ hai trong số 13 trường ĐH Việt Nam và 288 trong tổng số 1.854 trường đại học trên thế giới, theo kết quả xếp hạng các trường đại học, viện nghiên cứu trên thế giới năm 2022 của tổ chức xếp hạng các cơ sở nghiên cứu khoa học uy tín Tây Ban Nha – SCImago vừa công bố.<br><br></b><span>Việc Trường Đại học Mở Thành phố Hồ Chí Minh được công nhận vào top đầu các trường đại học Việt Nam ở lĩnh vực Kinh tế tại một bảng xếp hạng có uy tín quốc tế là động lực để tập thể Ban giám hiệu, cán bộ, viên chức, giảng viên, sinh viên Trường tiếp tục phấn đấu, nỗ lực không ngừng nâng cao chất lượng&nbsp;đào tạo và nghiên cứu khoa học.<br><br></span><span>SCImago Institutions Rankings&nbsp;(SCImago) ra đời từ năm 2009, là bảng xếp hạng uy tín, được các tổ chức như Bộ Khoa học và Công nghệ VN, Quỹ Nafosted sử dụng làm một trong các cơ sở để tham khảo cho quá trình đánh giá tổ chức khoa học công nghệ tại Việt Nam. Hằng năm, SCImago công bố kết quả xếp hạng một lần, dựa trên 3 tiêu chí:<br></span><br><span><b>–&nbsp;Năng lực nghiên cứu&nbsp;(50%)</b>: thực hiện dựa vào khối lượng, tác động và chất lượng của nghiên cứu từ cơ sở giáo dục.<br></span><span><b>–&nbsp;Sáng tạo và đổi mới&nbsp;(30%)</b>: được tính toán dựa trên số lượng đơn đăng ký bằng sáng chế của cơ sở giáo dục và các trích dẫn mà kết quả nghiên cứu của cơ sở giáo dục đó nhận được từ các bằng sáng chế.<br></span><span><b>–&nbsp;Tác động xã hội&nbsp;(20%)</b>: dựa vào số trang của website thuộc cơ sở giáo dục và số lượng liên kết ngược và thảo luận trên các mạng xã hội./.</span><b><br></b>',90,'2022-09-03 10:58:07.6'),(30,'Trường Đại học Mở TPHCM tổ chức Hội nghị Sơ kết công tác xây dựng Đảng 6 tháng đầu năm 2022','<span>Theo đó, Hội nghị được tổ chức vào sáng ngày 12/03/2021 tại hội trường 202, cơ sở 35-37 Hồ Hảo Hớn, Quận 1, Thành phố Hồ Chí Minh nhằm thực hiện Nghị quyết của Đảng ủy Trường Đại học Mở TPHCM. Trong dịp này, Nhà Trường cũng tổ chức Hội nghị nghiên cứu, quán triệt, học tập Nghị quyết Hội nghị lần thứ năm Ban Chấp hành Trung ương Đảng Khóa XIII.<br><br></span>Tham dự hội nghị có&nbsp;<i>Đ/c Nguyễn Thị Là</i><span>&nbsp;– Phó Bí thư Thường trực Đảng ủy Khối Đại học, Cao đẳng TPHCM; Về phía trường Đại học Mở TPHCM có&nbsp;</span><i>Đ/c Đỗ Sa Kỳ</i><span><i>&nbsp;</i>– Bí thư Đảng ủy, Chủ tịch hội đồng Trường;&nbsp;</span><i>Đ/c Tống Hào Kiệt</i><span>&nbsp;– Phó Bí thư Đảng ủy;&nbsp;</span><i>Đ/c Nguyễn Minh Hà</i><span>&nbsp;– Đảng ủy viên, Hiệu trưởng nhà Trường; và các đồng chí là Đảng ủy viên, cấp ủy các chi bộ, toàn thể Đảng viên trong Đảng ủy Trường.<br></span><br><span>Hội nghị đã thông qua Báo cáo kết quả công tác xây dựng Đảng 6 tháng đầu năm 2022, dưới sự lãnh đạo, chỉ đạo kịp thời của Đảng ủy, các đơn vị đã phát huy tính chủ động trong tổ chức thực hiện các nhiệm vụ được giao, cơ bản hoàn thành tốt các nhiệm vụ về công tác Đảng, hoạt động Công đoàn theo kế hoạch đề ra. Ngoài ra, Hội nghị cũng tập trung đánh giá những mặt còn hạn chế, thảo luận phương hướng, nhiệm vụ trọng tâm trong công tác xây dựng Đảng của nhà Trường trong việc nâng cao chất lượng, hiệu quả hoạt động trong 06 tháng cuối năm.<br></span><br><span>Đồng thời, Hội nghị nghiên cứu, quán triệt, học tập Nghị quyết Hội nghị lần thứ năm, Ban Chấp hành Trung ương Đảng Khóa XIII cũng được Đảng ủy Trường tổ chức trong dịp này. Với mục đích nghiên cứu, học tập, quán triệt và triển khai các nội dung văn kiện Hội nghị lần thứ năm Ban Chấp hành Trung ương Đảng khóa XIII tới Đảng ủy viên, cấp ủy các chi bộ, cán bộ, Đảng viên trong Đảng bộ Trường. Trên cơ sở đó, định hướng cấp ủy các cấp, tiếp tục quán triệt, tuyên truyền sâu rộng; xây dựng kế hoạch, chương trình hành động thực hiện các Nghị quyết, quyết định của Hội nghị, bảo đảm thiết thực, hiệu quả, góp phần đưa Nghị quyết Hội nghị nhanh chóng đi vào thực tiễn đời sống kinh tế – xã hội, hoàn thành thắng lợi các mục tiêu đề ra.</span><br>',90,'2022-09-03 11:00:20.6'),(31,'Hội nghị Sinh viên Nghiên cứu khoa học năm học 2021-2022','Sáng ngày 14/08/2022, Trường Đại học Mở TP.HCM đã tổ chức&nbsp;<b>Hội nghị Sinh viên Nghiên cứu khoa học năm học 2021-2022</b><span>&nbsp;tại hội trường 602, cơ sở 97 Võ Văn Tần,</span><i>&nbsp;</i><span>nhằm tổng kết, đánh giá lại quá trình triển khai và thực hiện hoạt động nghiên cứu khoa học trong sinh viên năm học 2021-2022; định hướng hoạt động Sinh viên Nghiên cứu khoa học năm học 2022-2023; và giới thiệu các chương trình Hỗ trợ Khởi nghiệp và đổi mới sáng tạo.<br><br></span><span>Hội nghị Sinh viên Nghiên cứu khoa học vinh dự chào đón Đồng chí Trần Đức Sự – Phó Giám đốc Trung tâm Phát triển Khoa học và Công nghệ Trẻ – Thành Đoàn Hội Sinh viên Thành phố. Về phía nhà trường, đến tham dự Hội nghị có GVCC.TS. Lê Xuân Trường – Phó Hiệu trưởng Nhà trường; TS. Lê Thái Thường Quân – Trưởng Phòng Hợp tác và Quản lý Khoa học; cùng quý thầy cô, lãnh đạo các Khoa, đại diện BTV Đoàn trường, BTK Hội sinh viên trường và toàn thể các sinh viên tham gia NCKH SV Trường ĐH Mở Tp. Hồ Chí Minh.<br></span><br>GVCC.TS. Lê Xuân Trường – Phó Hiệu trưởng Nhà trường cho biết:&nbsp;<span><i>“Tại Trường ĐH Mở TP. Hồ Chí Minh, phong trào sinh viên nghiên cứu khoa học luôn được nhà trường chú trọng, thầy cô và các bạn sinh viên hưởng ứng nhiệt liệt. Chính vì vậy, hoạt động nghiên cứu khoa học trên chặng đường 15 năm qua ngày càng phát triển. Không chỉ giới hạn cuộc thi của Nhà trường, các bạn sinh viên cũng đã tích cực thử sức ở các cuộc thi bên ngoài trường, đặc biệt là 2 cuộc thi truyền thống của các trường đại học, cuộc thi Sinh viên Nghiên cứu khoa học cấp Bộ và Sinh viên Nghiên cứu khoa học Eureka”</i>.<br></span><br><span>Tại Hội nghị, các nhóm sinh viên có đề tài Nghiên cứu khoa học trong năm 2021 được tuyên dương, cụ thể:<br></span><ul><li>01 giải nhất Sinh viên Nghiên cứu khoa học cấp Bộ của nhóm sinh viên khoa Công nghệ thông tin.</li><li>01 giải nhất Sinh viên Nghiên cứu khoa học Eureka của nhóm sinh viên khoa Công nghệ Sinh học.</li><li>01 giải khuyến khích Sinh viên Nghiên cứu khoa học Eureka của nhóm sinh viên khoa Công nghệ Sinh học.<br></li></ul><span>Tại Hội nghị, thầy cô đã chia sẻ những kinh nghiệm quý báu, tạo động lực để động viên mạnh mẽ tinh thần của các bạn sinh viên trên chặng đường nghiên cứu khoa học sắp tới. Thầy cô mong rằng các bạn sinh viên&nbsp;</span><b>đừng ngần ngại</b> và <b>hãy thử sức</b><span>&nbsp;với những dự án nghiên cứu khoa học của mình, đó sẽ là nền tảng giúp ích cho các bạn vững chắc hơn về lý thuyết lẫn kỹ năng, nâng cao năng lực bản thân và tìm được vị trí công việc tốt trong tương lai.</span><br><br>',90,'2022-09-03 11:03:07.5'),(32,'Hội thảo Kết nối cơ hội việc làm 2022','<span>Sáng ngày 13/08/2022, tại hội trường A cơ sở 97 Võ Văn Tần, Trường Đại học Mở TPHCM đã tổ chức hội thảo Kết nối cơ hội việc làm năm 2022. Chương trình nhằm kết nối, giúp sinh viên hiểu rõ xu hướng việc làm về năng lực chuyên môn cùng kỹ năng ứng tuyển.<br><br></span><span>Chương trình vinh dự với sự hiện diện của các vị diễn giả dày dặn kinh nghiệm: Anh Đặng Ngọc Tiến, HRBP Officer Jollibee VietNam; Anh Phan Chí Khang, Giám đốc huấn luyện nhân sự, cựu sinh viên QTKD; ThS. Nguyễn Thị Diệu Linh, Phó trưởng phòng Công tác sinh viên và truyền thông Trường Đại học Mở TPHCM; ThS Nguyễn Lê Minh Long, Giám đốc Trung tâm Hướng nghiệp – Tư vấn việc làm Trường Đại học Mở TPHCM.<br></span><br>Giúp các bạn sinh viên hiểu rõ hơn và có cái nhìn tổng quan chung về nhu cầu tuyển dụng của các doanh nghiệp và tình trạng đáp ứng nguồn nhân lực hiện nay.<i>&nbsp;</i><span><i>ThS. Nguyễn Thị Diệu Linh</i>&nbsp;</span><span>cho biết:“ Hiện nay, có rất nhiều việc làm dành cho sinh viên, đồng nghĩa với cơ hội việc làm cho sinh viên đang rộng mở nhưng tồn tại sự cạnh tranh lẫn nhau trong quá trình tìm việc.” Theo đó,&nbsp;</span>Cô<span>&nbsp;thông tin thêm về 5 nhóm nghề có nhu cầu tuyển dụng nhiều nhất hiện nay đó là: quản lý du lịch – khách sạn; tài chính – ngân hàng; thương mại điện tử; lao động sản xuất trong các ngành may mặc, da giày, lao động sản xuất trong ngành điện tử.<br></span><br><b>Hiểu mình đúng – chọn nghề đúng<br></b>Sự rộng mở cơ hội nghề nghiệp, cũng là nỗi băn khoăn của các bạn sinh viên về chọn công việc phù hợp với chính mình. “Để chọn được công việc phù hợp với bản thân, đầu tiên các bạn phải biết được bản thân thích gì, có điểm mạnh và điểm yếu nào để có thể xác định chính xác công việc mà mình yêu thích…”&nbsp;<span><i>Anh Phan Chí Khang</i>&nbsp;</span><span>chia sẻ.<br></span><br>Bên cạnh đó,&nbsp;anh Đặng Ngọc Tiến<span>&nbsp;cũng chia sẻ một số kênh thông tin tìm việc uy tín như trang tư vấn việc làm của nhà trường, công việc, kinh nghiệm tìm việc từ các anh chị khóa trước, hay tìm hiểu các công việc trên các nhóm trên mạng xã hội,.. và</span><span>&nbsp;Anh&nbsp;</span><span>cũng nhấn mạnh “Khi tìm việc trên các trang mạng xã hội, các bạn cũng nên hết sức chú ý vì nhiều nơi không có thật. Các bạn có thể sao chép địa chỉ, doanh nghiệp đó và tìm kiếm trên Google để kiểm tra có đáng tin cậy hay không”.<br></span><br><b>Kỹ năng viết sơ yếu lý lịch (CV) chinh phục Nhà tuyển dụng<br></b><span>Sơ yếu lý lịch được ví như giấy thông hành của ứng viên, và là một điểm gây ấn tượng đối với nhà tuyển dụng khi chưa gặp mặt. Vậy làm cách nào để viết Sơ yếu lý lịch chinh phục Nhà tuyển dụng ngay từ cái nhìn đầu tiên ?<br></span><b><br></b>Thầy <i>Nguyễn Minh Long&nbsp;</i><span>chia sẻ: “Một sơ yếu lý lịch tốt là một sơ yếu lý lịch ngắn gọn nhưng có đầy đủ thông tin: thông tin cá nhân, mục tiêu nghề nghiệp, quá trình học tập, kỹ năng, kinh nghiệm làm việc,… và để có những thông tin này là quá trình tích cực học tập, tham gia các hoạt động,…”<br></span><b><br></b><span>“Trước khi nộp hồ sơ xin việc vào một doanh nghiệp nào đó phải tìm hiểu kỹ yêu cầu công việc. Ngoài ra, các bạn nên tìm hiểu màu sắc, font chữ đặc thù của doanh nghiệp đó. Viết ngắn gọn, xúc tích và những kỹ năng kinh nghiệm liên quan đến công việc. Không nên gửi một sơ yếu lý lịch cho nhiều doanh nghiệp, công việc khác nhau.”&nbsp;Anh Đặng Ngọc Tiến&nbsp;chia sẻ.</span><span>Ngoài kỹ năng viết sơ yếu lý lịch các bạn sinh viên cần hiểu rõ yêu cầu chuyên môn của công việc và doanh nghiệp, biết mình đang ở đâuvà có sự chuẩn bị để phát triển các yêu cầu ấy<br></span><br><b>Kỹ năng phỏng vấn<br></b><span>Thường trước khi phỏng vấn, các ứng viên sẽ nhận được cuộc gọi thông báo và hẹn lịch gặp mặt. Vậy ứng xử như thế nào là đúng và tạo ấn tượng tốt?<br></span>Các bạn sinh viên ngay tại hội trường đã hào hứng trả lời câu hỏi ứng xử này ngay khi&nbsp;cô Nguyễn Thị Diệu Linh<span>&nbsp;đặt ra tình huống. “Khi nhận được cuộc điện thoại hay thư điện tử xác nhận phỏng vấn này, các bạn nên biết rõ người đang nói chuyện với mình là ai, sau đó là những thông tin về buổi phỏng vấn như thời gian, địa điểm”&nbsp;</span><span>cô Linh&nbsp;</span><span>chia sẻ.<br></span>Về kỹ năng phỏng vấn,&nbsp;anh Phan Chí Khang<span>&nbsp;có bổ sung để tăng ấn tượng của ứng viên đối với nhà tuyển dụng đó là một tinh thần tích cực và tràn đầy năng lượng.<br></span><br><b>Quá trình thử việc đến khi được nhận chính thức và cơ hội thăng tiến trong công việc<br></b><span>Khi vượt qua được vòng phỏng vấn, vẫn còn một thử thách đối với các bạn sinh viên đó là quá trình thử việc. Quá trình này thường kéo dài trong 2 tháng, điều này giúp các doanh nghiệp có thể đào tạo kiến thức chuyên môn về công việc rõ hơn. Ở giai đoạn này các bạn nên thể hiện kiến thức, kỹ năng liên quan mà mình có, bên cạnh đó là kỹ năng tự chủ, tự chịu trách nhiệm. Không thể thiếu đó là các bạn luôn luôn tích cực, học hỏi và ngày càng phát triển bàn thân,<br></span>Qua những kinh nghiệm mà các diễn giả đã thân mật chia sẻ, các bạn sinh viên cũng rất tích cực, mạnh dạn hỏi những vấn đề mà bản thân thắc mắc:“ Sinh viên năm ba, năm tư có nên bỏ qua bước thực tập, kiến tập mà trở thành nhân viên chính thức của doanh nghiệp hay không? Và bạn băn khoăn rằng bỏ qua bước thực tập, kiến tập này sẽ có những khó khăn hay lợi ích gì?” Câu hỏi từ&nbsp;<span>Bạn Uyển Nhi&nbsp;</span><span>– khoa Quản trị kinh doanh…</span><br><br><br>',90,'2022-09-03 11:06:13.0'),(33,'Lễ Tuyên dương sinh viên có thành tích cao trong học tập và rèn luyện','<span>Ngày 12/8/2022, 250 sinh viên có thành tích cao trong học tập và rèn luyện đã được Trường Đại học Mở TP.HCM tuyên dương tại Lễ tuyên dương sinh viên có thành tích tốt trong học tập và rèn luyện tại Hội trường 602, cơ sở 97 Võ Văn Tần.<br><br></span><span>Đến tham dự chương trình có các vị khách mời:<br></span><i>Về Đại diện của các Doanh nghiệp:<br></i><ul><li>Bà Nguyễn Thị Bích Phượng – Trưởng phòng nhân sự, Giám đốc Trung tâm đào tạo Ngân hàng TMCP Nam Á</li><li>Bà Lê Thị Hoà Bình – Phó Giám đốc chi nhánh TP.HCM, Ngân hàng TMCP Ngoại Thương Việt Nam</li><li>Ông Bùi Trần Mâng – Phó Giám đốc chi nhánh Bình Tây, Ngân hàng TMCP Ngoại Thương Việt Nam</li><li>Ông Nguyễn Ngọc Hiệp – Phó Giám đốc chi nhánh Nam Hoa, Ngân hàng Nông nghiệp và Phát triển Nông thôn</li><li>Bà Nguyễn Thị Anh Minh – Phó Giám đốc chi nhánh Trung tâm Sài Gòn, Ngân hàng Nông nghiệp và Phát triển Nông thôn</li><li>Ông Nguyễn Hữu Nghĩa – Phó Giám đốc chi nhánh Tây Sài Gòn, Ngân hàng BIDV</li><li>Ông Ngô Trí Việt – Giám đốc công ty cổ phần xây dựng nền tảng Việt</li><li>Ông Huỳnh Văn Viên – Giám đốc dự án Deco, TVN GROUP</li><li>Ông Nguyễn Tuấn Anh – Trưởng phòng quản lý dự án công ty cổ phần xây dựng CBC</li><li>Ông Trương Văn Chấn – Trưởng phòng quản lý chất lượng công ty cổ phần xây dựng Bách Khoa Sài Gòn</li></ul><i>Về phía Trường Đại học Mở TP. Hồ Chí Minh:<br></i><ul><li>TS. Lê Nguyễn Quốc Khang – Phó Hiệu trưởng</li><li>Ông Nguyễn Ngọc Anh – Trưởng phòng Công tác sinh viên và Truyền thông</li><li>Ông Trần Lê Trọng Phúc – Phó trưởng phòng Quản lý đào tạo</li><li>Đ/c Nguyễn Thị Thu Thảo – Bí thư Đoàn Thanh niên</li></ul>Cùng với lãnh đạo các Khoa thuộc Trường:&nbsp;<span>Ngoại ngữ, Đào tạo Đặc biệt, Tài chính – Ngân hàng, Kinh tế và Quản lý công, Quản trị kinh doanh, XHH – CTXH – ĐNÁ, Công nghệ sinh học, Công nghệ thông tin, Luật.<br></span><ul><li>TS. Nguyễn Trọng Phước, trưởng khoa Xây dựng,</li><li>TS. Vân Thị Hồng Loan, trưởng khoa Đào tạo Đặc Biệt, trường ĐH Mở TP.HCM.</li><li>TS. Phạm Hà, trưởng khoa Tài chính – Ngân hàng</li><li>TS.Lê Thành Tùng, phó trưởng khoa Kinh tế và Quản lý công</li><li>TS. Nguyễn Hoàng Sinh, phó trưởng khoa phụ trách khoa Quản trị kinh doanh</li><li>ThS. Lâm Thị Ánh Quyên, phó trưởng khoa phục trách khoa XHH – CTXH – ĐNÁ</li><li>TS. Nguyễn Thị Mỹ Hạnh, trưởng bộ môn Luật quốc tế – Luật thương mại, khoa Luật.</li></ul>&nbsp;Phát biểu tại buổi Lễ, TS. Lê Nguyễn Quốc Khang – Phó Hiệu trưởng trường gửi lời cảm ơn đến các Doanh nghiệp và chúc mừng các sinh viên được vinh danh. TS. Khang cho biết thêm:&nbsp;“Với mục đích hỗ trợ sinh viên trên con đường theo đuổi ước mơ của mình, mỗi năm học hơn 4.000 suất học bổng có giá trị hơn 20 tỷ đồng được Nhà trường trao tặng cho sinh viên học tập giỏi cũng như sinh viên có hoàn cảnh khó khăn nỗ lực trong học tập. Thông qua chính sách học bổng, Nhà trường mong muốn phần nào chia sẻ khó khăn đối với các sinh viên thuộc hộ nghèo, hộ cận nghèo; khích lệ các sinh viên hiếu học, có hạnh kiểm tốt và có chí tiến thủ. Nhà trường mong muốn và tin rằng sẽ nhận được nhiều sự quan tâm và đóng góp của các Doanh nghiệp qua việc tài trợ và trao học bổng để những hoàn cảnh khó khăn tiếp tục được giúp đỡ, có thêm tinh thần và sức khỏe để chuyên tâm vào việc học tập. Trao học bổng cũng là trao niềm tin của Doanh nghiệp vào thế hệ trẻ”.<span>&nbsp;<br><br></span><span>Bà Nguyễn Thị Bích Phượng – Trưởng phòng nhân sự, Giám đốc Trung tâm đào tạo Ngân hàng TMCP Nam Á, đại diện Doanh nghiệp cho biết sẽ luôn đồng hành cùng trường Đại học Mở TP.HCM, tiếp tục là động lực chắp cánh các cho các em viết tiếp ước mơ bay cao và bay xa hơn trong hành trình chinh phục tri thức”.<br></span><br><span>Đại diện toàn thể sinh viên, bạn Lê Trần Cẩm Thu – sinh viên khoa Quản trị kinh doanh đã gửi lời cảm ơn sâu sắc và tri ân đến Ban Giám hiệu Nhà trường và các Đơn vị tài trợ:&nbsp;“Chúng em xin phép gửi lời cảm ơn chân thành đến quý Nhà tài trợ với những suất học bổng quý báu để chúng em có thể vượt qua những khó khăn trước mắt, từng bước hoàn thành từng mục tiêu trên con đường học tập của mình. Chúng em nhận thức được rằng chỉ có con đường học tập mới giúp chúng em có cơ hội tốt đẹp trong tương lai, mới giúp gia đình thoát khỏi những khó khăn và sau nữa là cống hiến trí tuệ cho sự phát triển của xã hội.&nbsp; Đây cũng là lời hứa và trách nhiệm của bản thân: tiếp tục kiên định với thái độ, mục tiêu học tập và rèn luyện từng bước trưởng thành và tin tưởng trong tương lai gần nhất góp phần nhỏ bé của chúng em chăm sóc gia đình, xây dựng quê hương đất nước, giúp ích cho cộng đồng để không phụ lòng những tình cảm và niềm tin mà Thầy Cô, Nhà trường và các Nhà tài trợ đã dành cho chúng em.”<br></span><br><span>Tại buổi lễ, Trường Đại học Mở TP.HCM đã tuyên dương danh hiệu “Sinh viên học tập xuất sắc tiêu biểu năm 2020”, “Sinh viên học tập xuất sắc năm 2020”, sinh viên đạt học bổng “Khuyến khích&nbsp; nâng cao năng lực tiếng Anh”.</span><br>',90,'2022-09-03 11:08:44.9'),(34,'Trao nghị quyết bổ nhiệm lại chức vụ Phó Hiệu trưởng Trường Đại học Mở Thành phố Hồ Chí Minh','<span>Sáng ngày 01/8/2022, Trường ĐH Mở Thành phố Hồ Chí Minh công bố Nghị quyết bổ nhiệm lại Phó Hiệu trưởng Trường. Theo đó, tại buổi Lễ, GS.TS Nguyễn Minh Hà – Hiệu trưởng Trường và TS. Đỗ Sa Kỳ – Bí thư Đảng uỷ, Chủ tịch Hội đồng Trường đã trao Nghị quyết &nbsp;bổ nhiệm lại Phó Hiệu trưởng Trường đối với TS. Lê Nguyễn Quốc Khang và GVCC.TS. Lê Xuân Trường.<br><br></span><span>Phát biểu giao nhiệm vụ, Hiệu trưởng nhà trường – GS.TS. Nguyễn Minh Hà chúc mừng 2 Phó hiệu trưởng đã được Trường và các thành viên Nhà trường tin tưởng, tín nhiệm. Đồng thời, GS.TS Nguyễn Minh Hà khẳng định: trong 2 năm vừa qua, tuy có bị ảnh hưởng của dịch Covid-19, nhưng hai Phó hiệu trưởng đã cùng Hiệu trưởng và tất cả thầy, cô trong trường cố gắng đưa Trường vượt qua và đạt được những thành quả rất đáng ghi nhận: 16 chương trình đào tạo được kiểm định đạt, đảm bảo phát triển mạnh chất lượng đào tạo và cải thiện được đời sống của viên chức trong dịch Covid-19; Số lượng đăng ký nguyện vọng vào trường đều có tỷ lệ tăng qua các năm; Công tác sinh viên thực hiện định hướng của Ban Giám hiệu về nâng cao kỹ năng, thái độ sinh viên có những cải thiện…<br></span><br><span>Đại diện cho 2 Phó hiệu trưởng bổ nhiệm lại, GVCC.TS. Lê Xuân Trường trân trọng cảm ơn tập thể Nhà trường, lãnh đạo các đơn vị tin tưởng, quan tâm và ghi nhận sự phấn đấu của 2 phó hiệu trưởng. Đồng thời, hứa và khẳng định sẽ luôn nỗ lực phấn đấu, quyết tâm xây dựng tập thể Ban Giám hiệu nhà trường đoàn kết, cố gắng cùng nhau chung vai gắng sức với Hiệu trưởng, với tập thể cán bộ chủ chốt, tập thể trường để đưa trường ngày càng phát triển bền vững.<br></span><br><br>',90,'2022-09-03 11:10:49.7'),(35,'Trường Đại học Mở Tp. Hồ Chí Minh tham gia ngày hội tư vấn xét tuyển Đại học – Cao đăng năm 2022','<b>Ngày 24/7/2022, Trường Đại học Mở TP. Hồ Chí Minh tham gia Ngày hội tư vấn xét tuyển đại học, cao đẳng năm 2022 với 03 gian tư vấn cùng đội ngũ hơn 20 Thầy, Cô đến từ Phòng Quản lý Đào tạo và các khoa,… là thành viên Ban Tư vấn và quảng bá tuyển sinh 2022, đồng hành, tư vấn cho nhiều phụ huynh, thí sinh quan tâm, muốn đăng ký nguyện vọng xét tuyển vào trường. Ngày hội được tổ chức tại Trường Đại học Bách Khoa TPHCM với hàng ngàn bạn trẻ và phụ huynh đến tham dự.<br><br></b><span>Đây là một trong những chương trình tư vấn nằm trong khuôn khổ Chương trình tư vấn tuyển sinh – hướng nghiệp 2022 do báo Tuổi Trẻ, Vụ Giáo dục đại học (Bộ Giáo dục và đào tạo), Tổng cục Giáo dục nghề nghiệp (Bộ Lao động – thương binh và xã hội) phối hợp tổ chức, với sự đồng hành của Tập đoàn Vingroup và là một trong những hoạt động tư vấn chính của chương trình tư vấn quảng bá chung của Trường Đại học Mở TP. Hồ Chí Minh đồng hành nhiều năm qua, mang lại hiệu quả cao.<br></span><b><br></b><span>Với mong muốn chia sẻ được nhiều thông tin hữu ích và thiết thực đến nhiều thí sinh trong giai đoạn đăng ký và xác nhận nguyện vọng xét tuyển vào các trường từ ngày 22/7 đến 20/8/2022, đội ngũ ban tư vấn tuyển sinh Trường Đại học Mở TP. Hồ Chí Minh đã chuẩn bị chu đáo, cung cấp được nhiều thông tin chính xác nhất, mới nhất và kịp thời để thí sinh tìm hiểu trước khi đưa ra quyết định điều chỉnh nguyện vọng đăng ký xét tuyển đúng nguyện vọng.&nbsp;Bên cạnh đó, Ban tư vấn tuyển sinh cũng giải đáp nhiều thắc mắc về tuyển sinh, chọn ngành nghề sao cho phù hợp, đúng năng lực và hướng dẫn thí sinh điều chỉnh nguyện vọng đăng ký xét tuyển trên hệ thống chung của Bộ Giáo dục và Đào tạo.<br></span><b><br></b>Quan trọng hơn, tại chương trình, Ban tư vấn cũng đã cung cấp tho thí sinh và phụ huynh&nbsp;<span>thông tin xét tuyển đại học chính quy năm 2022 của Trường Đại học Mở TP. Hồ Chí Minh với 38 ngành xét tuyển, gồm 27 ngành đào tạo đại trà và 11 ngành đào tạo chất lượng cao. Trong đó có hai ngành mới tuyển sinh trong năm là ngành Quản lý công (chương trình đại trà) và ngành Kinh tế (chương trình chất lượng cao) và trường đang xét tuyển tất cả các ngành học theo Phương thức điểm thi Tốt nghiệp THPT năm 2022, cùng 28 tỷ học bổng tuyển sinh đang chờ trao cho các bạn, các thông tin hữu ích và thiết thực thu hút quan tâm của thí sinh.</span><b><br><br><br><br></b>',90,'2022-09-03 11:11:59.6'),(36,'Tọa đàm Khởi nghiệp: Dự án sinh viên khởi nghiệp: từ ý tưởng đến thực tiễn','Triển khai hiệu quả đề án “Hỗ trợ sinh viên khởi nghiệp – phục vụ cộng đồng” của nhà trường; Giúp sinh viên hiểu rõ hơn về quá trình xây dựng một dự án khởi nghiệp từ ý tưởng ban đầu đến dự án hoàn thiện và tham gia thị trường,&nbsp;<b>ngày 16/07/2022, Trường Đại học Mở TPHCM đã tổ chức Tọa đàm Khởi nghiệp với chủ đề “Dự án sinh viên khởi nghiệp: Từ ý tưởng đến thực tiễn”.<br><br></b><span>Sẵn sàng bước ra khỏi vùng an toàn của mình, không ngại khó khăn thử thách, kiên trì, bền bỉ. Con đường khởi nghiệp không phải lúc nào cũng trải đầy hoa hồng. Để khởi nghiệp thành công cần phải có ý tưởng tốt, có những cộng sự tốt và cuối cùng là có chuyên môn sâu trong lĩnh vực khởi nghiệp. Vì thương trường là chiến trường nên sinh viên cần phải trang bị cho bản thân đầy đủ vũ khí chiến đấu như kiến thức, kỹ năng, kinh nghiệm,… dấn thân học hỏi và trao dồi trước khi bước vào con đường kinh doanh.<br></span><b><br></b>Đây là những chia sẻ của các diễn giả&nbsp;<b>Kỹ sư Lê Trung Hiếu</b><span><b>&nbsp;– Nhà sáng chế và nhà sáng lập Ewater – Công ty Ewater Engineering</b> và<b>&nbsp;</b></span><b>ThS</b><span><b>&nbsp;Lê Hoài Việt –</b></span><span><b>&nbsp;Diễn giả khách mời</b> các chương trình tư vấn kĩ năng, định hướng giới trẻ với nhiều giải thưởng về các cuộc thi khởi nghiệp.</span><b><br></b>',90,'2022-09-03 11:12:44.3'),(37,'Seminar HR TECH – Cập nhật xu hướng HRM & HR TECH trong quản lý doanh nghiệp','<i>Sáng ngày 25/7/2022, toàn thể cán bộ viên chức (CBVC), giảng viên khoa Quản trị kinh doanh, trường ĐH Mở Tp. Hồ Chí Minh và các bạn sinh viên có đam mê đối với lĩnh vực nhân sự đã tham dự Seminar HR TECH tại&nbsp;</i><i>hội trường 602, cơ sở 97 Võ Văn Tần, Trường ĐH Mở Tp. Hồ Chí Minh.&nbsp;<br><br></i><span>Seminar HR TECH là chương trình hội thảo ứng dụng công nghệ trong lĩnh vực nhân sự được CLB Nhân sự trẻ, trường Đại học Mở Tp. Hồ Chí Minh tổ chức. Hội thảo được xem là dấu ấn đầu tiên cho bước ngoặt ký kết hợp tác giữa nhà trường và doanh nghiệp L&amp;A Holdings (ký kết vào buổi sáng cùng ngày). Đồng thời, tạo điều kiện cho sinh viên tiếp cận kiến thức và thông tin, xu hướng HRM &amp; HR TECH trong quản lý doanh nghiệp ở Việt Nam, giai đoạn “bình thường mới”.<br></span><i><br></i>Đến tham dự Chương trình, về phía doanh nghiệp L&amp;A có sự hiện diện của Bà Phạm Thị Mỹ Lệ – Chủ tịch HĐQT kiêm Tổng Giám đốc L&amp;A Holdings, Bà Phan Thị Mỹ Hằng – Giám đốc Vận hành L&amp;A Holdings; Bà Võ Ngọc Hạnh – Phụ trách thu hút nhân tài L&amp;A Holdings và đặc biệt là diễn giả – Ông Trương Chí Dũng, Giám đốc Nghiên cứu và Phát triển L&amp;A Holdings.<div><br><span>Về phía nhà trường, đến tham dự hội thảo có TS. Nguyễn Thế Khải – Trưởng bộ môn Nhân lực, khoa Quản trị kinh doanh; TS. Kiều Anh Tài – Trưởng bộ môn Marketing, khoa Quản trị kinh doanh cùng CBVC, giảng viên và toàn thể các sinh viên của Khoa Quản trị kinh doanh, Trường ĐH Mở Tp. Hồ Chí Minh.<br></span><br><span>Những chia sẻ tận tâm của diễn giả đã mang lại nhiều bài học hữu ích, có giá trị thực tiễn, giúp người tham dự khai thác đa góc nhìn mới trong xu hướng chuyển đổi số cho nhân sự, từ đó chủ động chuyển tiếp số hóa, tối ưu giải pháp nhân sự cho doanh nghiệp. Những nội dung quan trọng được diễn giả tâm đắc truyền đạt, bao gồm:<br></span><ol><li>Góc nhìn từ các Doanh nghiệp như cộng đồng Nhân sự SHRM và góc nhìn Tư vấn Công nghệ như Gartner, từ đó Phác thảo bức tranh tổng thể HR TECH… với các hiệu ứng lên việc quản trị nhân lực và thị trường lao động.</li><li>HR TECH, thể hiện qua các xu hướng và tiến hóa, giúp thay đổi cách quản trị Nhân sự, trải nghiệm làm việc của người làm nhân sự và nhân viên công ty.</li><li>Showcase: Ví dụ thực tế về những cải tiến công nghệ và chuyển đổi mô hình kinh doanh công nghệ tại L&amp;A nhằm mang lại trải nghiệm làm việc tốt hơn cho người làm nhân sự và tiết giảm chi phí cho công ty.</li></ol><span>Kết thúc Seminar HR TECH, đại diện khoa Quản trị kinh doanh, trường ĐH Mở Tp. Hồ Chí Minh đã trao tặng bó hoa tươi thắm, bày tỏ lòng biết ơn chân thành đến các vị khách quý, diễn giả của chương trình./</span><br></div>',90,'2022-09-03 11:13:50.2'),(38,'Khoá học “Giao tiếp trong công việc và ứng xử trên mạng xã hội” – Trường ĐH Mở Tp. Hồ Chí Minh','<i>Giao tiếp ứng xử thông minh, khéo léo là một trong những công cụ hỗ trợ con người chia sẻ, truyền đạt thông tin, cảm xúc hiệu quả, hướng đến việc đạt được một hay nhiều mục tiêu chung. Đặc biệt, trong môi trường công vụ, thành công trong giao tiếp với các cấp và ứng xử trên mạng xã hội là kỹ năng cần thiết, giúp cho cán bộ viên chức (CBVC), giảng viên, nhân viên… đang công tác tại Nhà trường hoàn thành xuất sắc nhiệm vụ được giao, xây dựng mối quan hệ công sở lành mạnh, chất lượng và gắn bó lâu dài với tổ chức.<br><br></i>Đó cũng là nội dung chính của&nbsp;Khoá học “Giao tiếp trong công việc và ứng xử trên mạng xã hội”<span>&nbsp;do Phòng Tổ chức – Nhân sự, Trường Đại học Mở Tp. Hồ Chí Minh&nbsp;</span>tổ chức vào ngày 21 và 22 tháng 7 năm 2022<span>&nbsp;tại Hội trường 202, cơ sở 35-37 Hồ Hảo Hớn, Phường Cô Giang, Quận 1.<br></span><i><br></i>Phát biểu tại Khoá học,&nbsp;GS.TS Nguyễn Minh Hà<span>&nbsp;– Hiệu trưởng Trường nhấn mạnh về ý nghĩa của việc tổ chức khoá học “Kỹ năng giao tiếp với cấp trên và ứng xử trên mạng xã hội”:&nbsp;</span>nhà trường khẳng định, bên cạnh tập huấn về trình độ chuyên môn nghiệp vụ thì kỹ năng mềm là một trong yếu tố quan trọng mà nhà trường muốn trang bị thêm cho CBVC và giảng viên của Nhà trường. Thông qua hành trang đó, mang lại hiệu quả thực thi công vụ tốt trong môi trường công sở. CBVC, giảng viên của Nhà trường không những hoàn thành tốt nhiệm vụ được giao mà còn giúp chúng ta thuận lợi hơn trong giao tiếp công việc và có ứng xử chuẩn mực trên mạng xã hội<span>.<br></span><i><br></i><span>Đồng hành trong 2 ngày 21 và 22 của đợt huấn luyện, giảng viên hướng dẫn – TS.GVC. Nguyễn Văn Tạo đã có những chia sẻ sâu sát các nội dung liên quan, trong đó các thực tế những tình huống cụ thể trong giao tiếp công việc và ứng xử trên mạng xã hội đã được Thầy Nguyễn Văn Tạo nêu ra và cùng thảo luận với người tham dự, cụ thể:<br></span><i><br></i>Giao tiếp ứng xử với cấp trên, cấp dưới và ngang cấp, theo đó,&nbsp;<span>các hoạt động giao tiếp ứng xử khéo léo với các cấp (như báo cáo với cấp trên, làm việc với đối tác, trao đổi công việc với cấp dưới…) là điều kiện cần để thông tin được truyền tải đầy đủ và chính xác, tránh sai lệch gây ảnh hưởng tiêu cực đến hiệu suất làm việc của bản thân nói riêng và tổ chức nói chung. Trong đó,&nbsp;</span>nguyên tắc giao tiếp nói chung<span>, giảng viên hướng dẫn – TS.GVC. Nguyễn Văn Tạo đúc kết, 7 (bảy) nguyên tắc giao tiếp giúp bạn thành công trong giao tiếp và ứng xử: Tôn trọng lẫn nhau; Bình đẳng, công khai trong giao tiếp; Cộng tác, hài hòa lợi ích; Phù hợp hoàn cảnh, quy luật khách quan; Tôn trọng quy luật tâm, sinh lý; Thẩm mỹ trong giao tiếp; Tin cậy nhau trong quá trình giao tiếp.<br></span><i><br></i>Bên cạnh đó, Thầy Tạo cũng có những gợi ý trong&nbsp;Giao tiếp, ứng xử với truyền thông với&nbsp;6 (sáu) nguyên tắc trong giao tiếp với truyền thông:<span>&nbsp;Đúng thẩm quyền, đúng các quy định: Luật Báo chí, Luật An ninh mạng; các Quy định về phát ngôn và cung cấp thông tin cho báo chí…</span><span>;&nbsp;</span>Trung thực; Năng động, linh hoạt: đa dạng hóa các hình thức tiếp cận với truyền thông hiện nay<span>;&nbsp;</span>Hợp tác: tôn trọng và hài hòa các lợi ích; Chuyên nghiệp: Có kiến thức, kỹ năng về cung cấp thông tin cho các phương tiện truyền thông đại chúng<span>;&nbsp;</span><span>Chủ động thiết lập và duy trì mối quan hệ với truyền thông đại chúng.<br></span><i><br></i>Tại nội dung<span>&nbsp;Giao tiếp và ứng xử trên mạng xã hội</span><span>, với thời đại hiện nay, thông tin trên mạng xã hội được xem là vòng xoáy có tốc độ lan truyền chóng mặt và có độ phủ cực lớn trên toàn cầu. Từ đó, đặt ra yêu cầu cho người dùng khi giao tiếp và ứng xử trên mạng xã hội phải tự trách nhiệm với các thông tin đăng tải. Giảng viên hướng dẫn đã có những điều cần lưu ý&nbsp;</span>tránh&nbsp;những hành vi bị xử phạt khi đăng thông tin trên mạng xã hội<span>&nbsp;khi người dùng sử dụng mạng xã hội để thực thi công vụ:<br></span><i><br></i><ol><li>Cung cấp, chia sẻ thông tin giả mạo, thông tin sai sự thật, xuyên tạc, vu khống, xúc phạm uy tín của cơ quan, tổ chức, danh dự, nhân phẩm của cá nhân</li><li>Cung cấp, chia sẻ thông tin cổ súy các hủ tục, mê tín, dị đoan, dâm ô, đồi trụy, không phù hợp với thuần phong, mỹ tục của dân tộc</li><li>Cung cấp, chia sẻ thông tin miêu tả tỉ mỉ hành động chém, giết, tai nạn, kinh dị, rùng rợn.</li><li>Cung cấp, chia sẻ thông tin bịa đặt, gây hoang mang trong Nhân dân, kích động bạo lực, tội ác, tệ nạn xã hội, đánh bạc hoặc phục vụ đánh bạc</li><li>Cung cấp, chia sẻ các tác phẩm báo chí, văn học, nghệ thuật, xuất bản phẩm mà không được sự đồng ý của chủ thể quyền sở hữu trí tuệ hoặc chưa được phép lưu hành hoặc đã có quyết định cấm lưu hành hoặc tịch thu</li><li>Quảng cáo, tuyên truyền, chia sẻ thông tin về hàng hóa, dịch vụ bị cấm</li><li>Cung cấp, chia sẻ hình ảnh bản đồ Việt Nam nhưng không thể hiện hoặc thể hiện không đúng chủ quyền quốc gia.</li><li>Cung cấp, chia sẻ đường dẫn đến thông tin trên mạng có nội dung bị cấm</li></ol><span>Kết thúc khoá học, TS.GVC. Nguyễn Văn Tạo đã trao chứng nhận hoàn thành Khoá học cho các CBVC, giảng viên tham dự. Tin rằng, các CBVC, giảng viên tham dự đã được lắng nghe và tích luỹ nhiều kiến thức hữu ích về góc nhìn tổng quan giao tiếp ứng xử, kỹ năng giao tiếp ứng xử, các nguyên tắc giao tiếp với truyền thông, cách xử lý các tình huống giao tiếp trên mạng xã hội…</span><br><ol><li>Tiết lộ thông tin thuộc danh mục bí mật nhà nước, bí mật đời tư của cá nhân và bí mật khác mà chưa đến mức truy cứu trách nhiệm hình sự.</li></ol>',90,'2022-09-03 11:15:31.5');
